import React from "react";

const Getval = (props)=>{

    return(
        <>
            <div className="theitem">
                <li> <i className="fas fa-times-circle" id="myicon" 
                onClick= {()=>{
                    return props.onselect(props.id)
                }}></i> {props.text} </li>
            </div>
        </>
    );
}

export default Getval;
